import React from 'react';
import { Card, CardImg, CardText, CardBlock,
  CardTitle, CardSubtitle, Button } from 'reactstrap';

class BabysitterCard extends React.Component {

    constructor(props){
        super(props)
    }

render() {
    let { id, first_name, last_name, phone_number} = this.props.BabysitterCard
    return (
        <div>
            <Card>
                <CardBlock>
                    <CardTitle>{last_name}, {first_name}</CardTitle>
                    <CardText>{phone_number}</CardText>
                    <Button onClick={this.handleOnClick}>View Availability</Button>
                </CardBlock>
            </Card>
        </div>
    )
}

}

export default BabysitterCard
